INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(7, 1, 'Ch Em n Ngy Mai', '\"Ch Em n Ngy Mai\" l mt cu chuyn tnh cm y xc ng v lng mn ca o din L Hong, pht hnh vo nm 2013. B phim k v cuc sng ca An v H, hai con ngi c s phn gn kt vi nhau qua nhng tnh hung khng ng.\r\n\r\nAn, mt c gi tr si ni, lun gi vng nim tin vo tnh yu v cuc sng. Trong khi , H li l mt chng trai chn chn, sng quyt on v t tin. S gp g ca h l mt s tnh c, nhng mi khonh khc h bn nhau li l c hi  h hiu r hn v lng tin v tnh yu.\r\n\r\nBi cnh ca b phim l thnh ph H Ni lng mn, ni m cu chuyn tnh yu ca An v H c th hin qua nhng cnh quay p mt v li thoi su sc. \"Ch Em n Ngy Mai\" khng ch l mt b phim gii tr m cn l mt cu chuyn y  ngha v tnh yu v hy vng, khin khn gi cm thy nh nhng v m p sau khi xem xong.', '2024-04-14 10:26:24', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(8, 1, 'Em Cha 18', '\"Em Cha 18\" l mt b phim tnh cm hc ng ca o din L Thanh Sn, ra mt vo nm 2017, vi s tham gia ca dn din vin tr trung v ti nng nh Kaity Nguyn, Kinh Quc, Jun Phm, v Ng Kin Huy.\r\n\r\nCu chuyn xoay quanh cuc sng ca Lm, mt c gi tr nng ng v hn nhin, nhng li phi i mt vi nhng kh khn v p lc t gia nh v x hi. Trong qu trnh trng thnh, Lm gp g v pht trin tnh bn c bit vi Hong, mt chng trai tt bng v thng minh.\r\n\r\n\"Em Cha 18\" khng ch l cu chuyn v tnh bn v tnh yu tui teen, m cn l hnh trnh tm kim bn thn v xc nh c m trong cuc sng. Bng cch k chuyn gn gi v chn thc, b phim  chm n lng khn gi, th hin s trng thnh v l tr ca nhng ngi tr tui. ng thi, \"Em Cha 18\" cng l mt thng ip v tnh bn, s ng cm v hy vng trong mi hon cnh.', '2024-04-14 10:30:18', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(9, 1, 'C Gi n T Hm Qua', '\"C Gi n T Hm Qua\" l mt b phim tnh cm vin tng ca o din Phan Gia Nht Linh, ra mt vo nm 2017, mang n mt cu chuyn mi l v y n tng v tnh yu v thi gian.\r\n\r\nCu chuyn bt u khi Linh, mt c gi xinh p v b n, xut hin trong cuc sng ca Hong - mt chng trai hin i ang gp kh khn trong tnh yu v cng vic. Linh khng ch mang theo s sng to v nim am m vo cuc sng ca Hong m cn lm thay i hon ton con ngi anh.\r\n\r\nQua tng khonh khc ngt ngo v xc ng, \"C Gi n T Hm Qua\"  cp n nhng kha cnh phc tp ca tnh yu v thi gian. B phim khng ch l mt cu chuyn tnh yu p  m cn l mt tc phm trit l v  ngha ca vic sng v yu thng.\r\n\r\nVi din xut xut sc ca dn din vin gm Qunh Nga, Khng Ngc, v Nh Phng, \"C Gi n T Hm Qua\"  gy n tng mnh m vi khn gi bi ct truyn su sc v hnh nh p mt. B phim khng ch l mt la chn gii tr tuyt vi m cn l mt bi hc v  ngha ca cuc sng v gi tr ca thi gian.', '2024-04-14 10:32:33', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(10, 1, 'Gi Gic M V', '\"Gi Gic M V\" l mt b phim tnh cm m cht hi hc ca o din Vit Linh, ra mt vo nm 2014,  gy n tng mnh m vi khn gi bi ct truyn li cun v din xut ti nng ca cc din vin.\r\n\r\nCu chuyn xoay quanh cuc sng ca Hi - mt chng trai tr y hoi bo, lun m v tnh yu v thnh cng trong s nghip. Mt ngy, anh tnh c gp c Ngc - mt c gi ti mi, lc quan v y sc ht. T lc gp g u tin, hai ngi bt u c nhng mi quan h gn gi v pht trin tnh cm.\r\n\r\nTuy nhin, h phi i mt vi nhiu kh khn v th thch trong cuc sng, t nhng hiu lm n s phn i t gia nh. Qua tng tr ngi, Hi v Ngc cng nhau vt qua v hiu ra  ngha thc s ca tnh yu v s hi sinh.\r\n\r\nVi s tham gia ca cc din vin hng u nh L Bnh, Qunh Nga, Trung Dn v Thi Ha, \"Gi Gic M V\"  to ra mt bc tranh y mu sc v tnh yu v hy vng. B phim khng ch mang li ting ci sng khoi m cn lm tan chy tri tim ca khn gi bng thng ip  ngha v tnh yu v s qu trng cuc sng.', '2024-04-14 10:33:21', 'data:image/jpeg;base64,');
INSERT INTO `movies` (`id`, `genre_id`, `title`, `decription`, `createat`, `img`) VALUES
(11, 1, 'Em L B Ni Ca Anh', '\"Em L B Ni Ca Anh\" l mt b phim tnh cm hi hc ca o din L Vn Kit, ra mt vo nm 2015, vi s tham gia ca dn din vin ni ting nh Jun V, Kh Nh, v Trn Thnh.\r\n\r\nCu chuyn bt u khi An - mt c gi tr vui v v nng ng, bt ng phi nhp vin v tai nn v mt tr nh. An tnh dy v cho rng mnh l b ni ca Anh, mt chng trai tr v thnh t, nhng tht ra Anh ch l bc s chm sc An ti bnh vin. T y, cuc phiu lu v nhng tnh hung hi hc bt u din ra khi An v Anh cng nhau tri qua nhng khonh khc y bt ng v lng mn.\r\n\r\nBn cnh yu t hi hc, b phim cng chm n nhng tnh cm chn thnh v  ngha ca gia nh, tnh bn v tnh yu. Qua tng tnh tit, \"Em L B Ni Ca Anh\" l mt cu chuyn v s hiu bit, quan tm v hy vng trong cuc sng.\r\n\r\nVi din xut t nhin v y sc sng ca cc din vin, cng vi kch bn hp dn v hnh nh p mt, b phim  thu ht s ch  ca ng o khn gi v nhn c nhiu li khen ngi t gii ph bnh. \"Em L B Ni Ca Anh\" khng ch mang li ting ci sng khoi m cn gp phn tht cht tnh cm v gn kt trong mi gia nh.', '2024-04-14 10:34:54', 'data:image/jpeg;base64,');

